function App() {
  const expense = [
    {date: new Date(2022,6,12), title:'Car Insurance', amount:263.56},
    {date: new Date(2022,6,12), title:'Car Insurance', amount:263.56},
    {date: new Date(2022,6,12), title:'Car Insurance', amount:263.56},
    {date: new Date(2022,6,12), title:'Car Insurance', amount:263.56},
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
